webpackJsonp([0xc16286ab2a8a],{1019:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Most props on a JSX element are passed on to the component, however, there are two special props (<code class="gatsby-code-text">ref</code> and <code class="gatsby-code-text">key</code>) which are used by React, and are thus not forwarded to the component.</p>\n<p>For instance, attempting to access <code class="gatsby-code-text">this.props.key</code> from a component (eg. the render function) is not defined.  If you need to access the same value within the child component, you should pass it as a different prop (ex: <code class="gatsby-code-text">&lt;ListItemWrapper key={result.id} id={result.id} /&gt;</code>). While this may seem redundant, itâ€™s important to separate app logic from reconciling hints.</p>',frontmatter:{title:"Special Props Warning",next:null,prev:null},fields:{path:"warnings/special-props.md",slug:"warnings/special-props.html"}}},pathContext:{slug:"warnings/special-props.html"}}}});
